import { React, useState } from "react";
import "./navbar.css";
import { FaAlignRight, FaRegWindowClose } from "react-icons/fa";
import { MdClear, MdViewHeadline } from "react-icons/md";
import Logo from "../../assets/logo.svg";
import Menu from "./Menu";

const Navbar = () => {
  const [toggle, setToggle] = useState(false);
  return (
    <div className="gpt3_navbar">
      <div className="gpt3_navbar-links">
        <div className="gpt3_navbar-links_logo">
          <img src={Logo} alt="logo" />
        </div>
        <div className="gpt3_navbar-links_container">
          <Menu />
        </div>
      </div>
      <div className="gpt3_navbar-sign">
        <p>sign in</p>
        <button type="button" className="button">
          sign Up
        </button>
      </div>
      <div className="gpt3_navbar-menu">
        {toggle ? (
          <MdClear
            className="bars"
            color="#fff"
            width={27}
            onClick={() => setToggle(false)}
          />
        ) : (
          <MdViewHeadline
            className="bars"
            color="#fff"
            width={27}
            onClick={() => setToggle(true)}
          />
        )}
        {toggle && (
          <div className="gpt3_navbar-menu_container scale-up-center">
            <div className="gpt3_navbar-menu_container_links">
              <Menu />
              <div className="gpt3_navbar-sign_menu">
                <p>sign in</p>
                <button type="button" className="button">
                  sign Up
                </button>
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default Navbar;
